import React from 'react';
import '../scss/Output.scss';




export default function Output({outputColor, outputWidth, outputHeight, outputBorderRadius}) {
    const rectStyle = {
        backgroundColor: outputColor,
        width: `${outputWidth}px`,
        height: `${outputHeight}px`,
        borderRadius: `${outputBorderRadius}px`
    }


    return (
        <div className='output-rect' style={rectStyle}>
        </div>
    )
}
